pragma solidity ^0.4.23;

import "../node_modules/zeppelin-solidity/contracts/ownership/Ownable.sol";
import "../node_modules/zeppelin-solidity/contracts/math/SafeMath.sol";

import "../node_modules/zeppelin-solidity/contracts/token/ERC20/DetailedERC20.sol";
import "./GenericERC20.sol";

contract DelegateBackingERC20Token is Ownable {
    using SafeMath for uint256;

    struct Backe {
        uint256 amount;
        uint256 proposalAddress;
        address delegator;
        address beneficiary;
        address token;
        bool principal;
        bool dlnRewards;
        bool dlnGRewards;
        bool delegateControl;
    }

    struct Proposal {
        uint256 amount;
        uint256 proposalAddress;
        address delegator;
        address beneficiary;
        address token;
        bool principal;
        bool dlnRewards;
        bool dlnGRewards;
        bool delegateControl;
    }

    mapping(address => Backe) backes;
    mapping(uint256 => Proposal) proposals;
    address[] internal backholders;
    uint256[] internal proposalsAddresses;

    // ---------- STAKES ----------

    /**
     * @notice A method for a backholder to create a back.
     * @param _back The size of the back to be created.
     */
    function createBack(
        uint256 _back,
        uint256 _proposalAddress,
        address _delegator,
        address _benefeciary,
        GenericERC20 _token,
        bool principal,
        bool dlnRewards,
        bool dlnGRewards,
        bool delegateControl
    ) public {
        if (backes[_delegator].amount == 0) addBackholder(_delegator);
        backes[_delegator] = Backe(
            _back,
            _proposalAddress,
            _delegator,
            _benefeciary,
            _token,
            principal,
            dlnRewards,
            dlnGRewards,
            delegateControl
        );

        proposals[_proposalAddress] = Proposal(
            _back,
            _proposalAddress,
            _delegator,
            _benefeciary,
            _token,
            principal,
            dlnRewards,
            dlnGRewards,
            delegateControl
        );
        backes[_delegator].amount = backes[_delegator].amount.add(_back);
    }

    /**
     * @notice A method for a backholder to remove a back.
     * @param _back The size of the back to be removed.
     */
    // function removeBack(uint256 _back, MintableToken _token) public {
    function removeBack(uint256 _back, address _delegator) public {
        backes[_delegator].amount = backes[_delegator].amount.sub(_back);
        if (backes[_delegator].amount == 0) {
            removeBackholder(_delegator);
            removeProposal(backes[_delegator].proposalAddress);
        }
    }

    /**
     * @notice A method to retrieve the back for a backholder.
     * @param _backholder The backholder to retrieve the back for.
     * @return uint256 The amount of wei backd.
     */
    function backOf(address _backholder) public view returns (uint256) {
        return backes[_backholder].amount;
    }

    /**
     * @notice A method to the aggregated backs from all backholders.
     * @return uint256 The aggregated backs from all backholders.
     */
    function totalBacks() public view returns (uint256) {
        uint256 _totalBacks = 0;
        for (uint256 s = 0; s < backholders.length; s += 1) {
            _totalBacks = _totalBacks.add(backes[backholders[s]].amount);
        }
        return _totalBacks;
    }

    // ---------- STAKEHOLDERS ----------

    /**
     * @notice A method to check if an address is a backholder.
     * @param _address The address to verify.
     * @return bool, uint256 Whether the address is a backholder,
     * and if so its position in the backholders array.
     */
    function isBackholder(address _address)
        public
        view
        returns (bool, uint256)
    {
        for (uint256 s = 0; s < backholders.length; s += 1) {
            if (
                (_address == backholders[s] &&
                    !backes[backholders[s]].delegateControl) ||
                _address == backes[backholders[s]].beneficiary
            ) return (true, s);
        }
        return (false, 0);
    }

    function isProposal(uint256 _proposalAddress)
        public
        view
        returns (bool, uint256)
    {
        for (uint256 s = 0; s < proposalsAddresses.length; s += 1) {
            if (_proposalAddress == proposalsAddresses[s]) return (true, s);
        }
        return (false, 0);
    }

    function getProposal(uint256 _proposalAddress)
        public
        view
        returns (
            uint256,
            address,
            address,
            address,
            bool,
            bool,
            bool
        )
    {
        return (
            proposals[_proposalAddress].amount,
            proposals[_proposalAddress].delegator,
            proposals[_proposalAddress].beneficiary,
            proposals[_proposalAddress].token,
            proposals[_proposalAddress].principal,
            proposals[_proposalAddress].dlnRewards,
            proposals[_proposalAddress].dlnGRewards
        );
    }

    function getBenefeciary(address _address)
        public
        view
        returns (
            uint256,
            address,
            address,
            address,
            bool,
            bool,
            bool
        )
    {
        return (
            backes[_address].amount,
            backes[_address].delegator,
            backes[_address].beneficiary,
            backes[_address].token,
            backes[_address].principal,
            backes[_address].dlnRewards,
            backes[_address].dlnGRewards
        );
    }

    function isDelegateControl(address _address) public view returns (bool) {
        return (backes[_address].delegateControl);
    }

    function getProposalAddress(address _address)
        public
        view
        returns (uint256)
    {
        return (backes[_address].proposalAddress);
    }

    /**
     * @notice A method to add a backholder.
     * @param _backholder The backholder to add.
     */
    function addBackholder(address _backholder) public {
        (bool _isBackholder, ) = isBackholder(_backholder);
        if (!_isBackholder) backholders.push(_backholder);
    }

    function addProposal(uint256 _proposal) public {
        (bool _isProposal, ) = isProposal(_proposal);
        if (!_isProposal) proposalsAddresses.push(_proposal);
    }

    /**
     * @notice A method to remove a backholder.
     * @param _backholder The backholder to remove.
     */
    function removeBackholder(address _backholder) public {
        (bool _isBackholder, uint256 s) = isBackholder(_backholder);

        if (_isBackholder) {
            // backholders.pop();
            delete backholders[s];
            backholders[s] = backholders[backholders.length - 1];
        }
    }

    function removeProposal(uint256 _proposalAddress) public {
        (bool _isProposal, uint256 s) = isProposal(_proposalAddress);

        if (_isProposal) {
            delete proposalsAddresses[s];
            proposalsAddresses[s] = proposalsAddresses[
                proposalsAddresses.length - 1
            ];
        }
    }
}

